import * as React from "react";
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import { useStyles } from "./HeaderStyle";
import { Theme } from "../Theme";
import { Box } from "@mui/system";
import { Hidden } from "@material-ui/core";




const Navbar = ({ navButtons }) => {
  const classes = useStyles();

  return (
    <AppBar className={classes.navbar} position="fixed" sx={{backgroundColor:Theme.colors.deepest}} >
      <Toolbar className={classes.ToolBar}>
        <Typography
          variant="h5"
          component="h6"
          sx={{ flexGrow: 1, fontSize: 20 }}
          style={{ backgroundColor: Theme.colors.deep }}
        >
          @dincerhuseyiin
        </Typography>
        <Box component={Hidden} xsDown>
          <Box>

          
        {navButtons.map((item, i) => (
          <Button className={classes.navlinks} color="inherit" key={i}>
            {item.name}
          </Button>
        ))}
            </Box>
            </Box>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
